import React from 'react';
import {
  SafeAreaView,
  Text,
  Image,
  StyleSheet,
  View,
  ScrollView,
  ActivityIndicator,
  StatusBar,
} from "react-native";
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';

const useStyles = makeStyles({
  root: {
    width: 500,
  },
  navBar: {
    flex: 1,
    backgroundColor: "#2d2f30",
  },
  navBarText: {
    color: "white",
  },
  topBar: {
    backgroundColor: "red",
    fontSize: "55px",
    flex: 1,
    textAlign: "center",
  },
  bottom: {
    flex: 1,
    justifyContent: 'flex-end',
    marginBottom: 36,
    position: 'absolute',
    bottom: 0,
  },
});

export default function App() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  return (
    <div>
    <header className={classes.topBar}>
      APP NAME
    </header>
    <View>
      Hello
    </View>
    <View style={{flex: 1,
  justifyContent: 'flex-end',
  marginBottom: 36}}>
      <BottomNavigation
        value={value}
        onChange={(event, newValue) => {
          setValue(newValue);
        }}
        showLabels
        className={classes.navBar}
      >
        <BottomNavigationAction label="Recents" icon={<RestoreIcon />} className={classes.navBarText} />
        <BottomNavigationAction label="Favorites" icon={<FavoriteIcon />} className={classes.navBarText} />
        <BottomNavigationAction label="Nearby" icon={<LocationOnIcon />} className={classes.navBarText} />
      </BottomNavigation>
    </View>
    <View>
      Hello
    </View>
    </div>
  );
}
